import torch
from torch import nn
from torch.utils.data import DataLoader
from torchvision import transforms
from torchvision.transforms import ToTensor
from torch import optim
from torchvision import datasets

"""![image_2024-11-19_133908730.png](data:image/png;base64,)

Descarcari train set si test-set

![image_2024-11-19_134944503.png](data:image/png;base64,)
"""

train_transform = transforms.Compose([
    transforms.ToTensor(),
    transforms.Normalize((0.1307,), (0.3081,))
])

test_transform = transforms.Compose([
    transforms.ToTensor(),
    transforms.Normalize((0.1307,), (0.3081,))
])

train_data = datasets.MNIST(
    root = "data",
    train = True,
    download = True,
    transform = train_transform
)

test_data = datasets.MNIST(
    root = "data",
    train = False,
    download = True,
    transform = test_transform
)

"""Dataloaders"""

batch_size = 128

train_dataloader = DataLoader(train_data, batch_size = batch_size)
test_dataloader = DataLoader(test_data, batch_size = batch_size)

"""Selectam device ul

Definim modelul
"""

import torch
from torch import nn


class CNN(nn.Module):
    def __init__(self):
        super(CNN, self).__init__()
        self.model = nn.Sequential(
            nn.Conv2d(1, 16, 3),  # 28x28 -> 26x26
            nn.ReLU(),
            nn.MaxPool2d(2),  # 26x26 -> 13x13
            nn.Conv2d(16, 32, 3),  # 13x13 -> 11x11
            nn.ReLU(),
            nn.MaxPool2d(2),  # 11x11 -> 5x5
            nn.Flatten(),  # 32 * 5 * 5 = 800
            nn.Linear(32 * 5 * 5, 256),
            nn.Linear(256, 128),
            nn.Linear(128, 10)
        )

    def forward(self, x):  # Asigur-te c forward este corect indentat!
        return self.model(x)

model = CNN().to(device)

device = "cuda" if torch.cuda.is_available() else "cpu"
model.to(device)

print(f"se utilizeaza {device} device")

loss_fn = nn.CrossEntropyLoss()
optimizer = torch.optim.SGD(model.parameters(), lr=1e-3)

def train(train_dataloader, model, loss_fn, optimizer):
    size = len(train_dataloader.dataset)
    model.train()
    for batch, (X, y) in enumerate(train_dataloader):
        X, y = X.to(device), y.to(device)

        # Compute prediction error
        pred = model(X)
        loss = loss_fn(pred, y)

        # Backpropagation
        loss.backward()
        optimizer.step()
        optimizer.zero_grad()

        if batch % 100 == 0:
            loss, current = loss.item(), (batch + 1) * len(X)
            print(f"loss: {loss:>7f}  [{current:>5d}/{size:>5d}]")

def test(train_dataloader, model, loss_fn):
    size = len(train_dataloader.dataset)
    num_batches = len(train_dataloader)
    model.eval()
    test_loss, correct = 0, 0
    with torch.no_grad():
        for X, y in train_dataloader:
            X, y = X.to(device), y.to(device)
            pred = model(X)
            test_loss += loss_fn(pred, y).item()
            correct += (pred.argmax(1) == y).type(torch.float).sum().item()
    test_loss /= num_batches
    correct /= size
    print(f"Test Error: \n Accuracy: {(100*correct):>0.1f}%, Avg loss: {test_loss:>8f} \n")

epochs = 5
for t in range(epochs):
    print(f"Epoch {t+1}\n-------------------------------")
    train(train_dataloader, model, loss_fn, optimizer)
    test(test_dataloader, model, loss_fn)
print("Done!")